CREATE TABLE `oa_achievement` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `creatorID` varchar(20) DEFAULT NULL COMMENT '创建者',
  `title` varchar(50) DEFAULT NULL COMMENT '标题',
  `description` varchar(100) DEFAULT NULL COMMENT '描述',
  `othername` varchar(200) DEFAULT NULL COMMENT '其他合作者',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `updatetime` datetime DEFAULT NULL COMMENT '修改时间',
  `type` varchar(20) DEFAULT NULL COMMENT '类型',
  `teaID` varchar(20) DEFAULT NULL COMMENT '指导老师',
  `checked` enum('-1','1','0') DEFAULT '0' COMMENT '0：审核中 1：通过 -1：未通过',
  `checkID` int(20) DEFAULT NULL COMMENT '审核者id',
  `checktime` datetime DEFAULT NULL COMMENT '审核时间',
  `deleted` enum('0','1') NOT NULL DEFAULT '0' COMMENT '1:表示已删除，0表示未删除',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
