--
-- Table structure for table `oa_task`
--

DROP TABLE IF EXISTS `oa_task`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `oa_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `asgID` varchar(20) DEFAULT NULL COMMENT '安排者',
  `acpID` varchar(20) DEFAULT NULL COMMENT '接受者',
  `title` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '标题',
  `content` text CHARACTER SET utf8 COMMENT '内容',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `updatetime` datetime DEFAULT NULL COMMENT '更新时间',
  `completetime` datetime DEFAULT NULL COMMENT '完成时间',
  `begintime` datetime DEFAULT NULL COMMENT '开始时间',
  `deadline` datetime DEFAULT NULL COMMENT '截止时间',
  `assesstime` datetime DEFAULT NULL COMMENT '批阅日期',
  `submittime` datetime DEFAULT NULL COMMENT '学生提交日期',
  `ACL` enum('3','2','1') DEFAULT '1' COMMENT '访问控制：1仅自己可见，2仅小组可见，3公开。',
  `deleted` enum('0','1') NOT NULL DEFAULT '0',
  `readtime` datetime DEFAULT NULL COMMENT '是否已读',
  `readtimes` int(11) DEFAULT '0' COMMENT '查看次数',
  `submitcontent` text CHARACTER SET utf8,
  `updatesubmittime` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

