\"color:#000000;font-family:宋体, Tahoma;\"><br />\r\n</p>\r\n<p style=\"color:#000000;font-family:宋体, Tahoma;\">同时第11周未完成的高等数学第一章题目，也一并完成，周五下午带好作业本到实验室。</p>\r\n</p>','2014-11-22 15:02:07',NULL,'2014-12-22 11:13:57','2014-11-22 15:02:07','2014-11-30 23:59:59','2014-12-22 11:13:54','2014-11-28 15:04:53','3','0','2014-11-23 13:10:37',15,'',NULL),(18,'yangzhe','1427406060','12周学习任务','<p>请于周六前完成以下C语言题目，并将程序以附件形式上传。</p>\r\n<p><div style=\"color:#000000;font-family:宋体, Tahoma;\">1、有1、2、3、4个数字，能组成多少个互不相同且无重复数字的三位数？都是多少？</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">2、一个整数，它加上100后是一个完全平方数，再加上168又是一个完全平方数，请问该数是多少？</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">3、将一个正整数分解质因数。例如：输入90,打印出 90=2*3*3*5</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">4、输入一行字符，分别统计出其中英文字母、空格、数字和其它字符的个数。</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">5、输入一串不少于10位的由数字组成的字符串，然后按照1+2+3循环模式将字符串分解成一位，二位，三位的整数，然后用选择排序对其进行排序</div>\r\n<p style=\"color:#000000;font-family:宋体, Tahoma;\">例如：‘16758945864738502’分解为1，67，589，4，58，647，3，85，02，然后进行排序</p>\r\n<p style=\"color:#000000;font-family:宋体, Tahoma;\"><br />\r\n</p>\r\n<p style=\"color:#000000;font-family:宋体, Tahoma;\">同时第11周未完成的高等数学第一章题目，也一并完成，周五下午带好作业本到实验室。</p>\r\n</p>','2014-11-22 15:02:07',NULL,'2014-12-22 11:13:44','2014-11-22 15:02:07','2014-11-30 23:59:59','2014-12-22 11:13:41','2014-11-30 22:13:00','3','0','2014-11-24 07:14:08',19,'...',NULL),(19,'yangzhe','1427405033','12周学习任务','<p>请于周六前完成以下C语言题目，并将程序以附件形式上传。</p>\r\n<p><div style=\"color:#000000;font-family:宋体, Tahoma;\">1、有1、2、3、4个数字，能组成多少个互不相同且无重复数字的三位数？都是多少？</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">2、一个整数，它加上100后是一个完全平方数，再加上168又是一个完全平方数，请问该数是多少？</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">3、将一个正整数分解质因数。例如：输入90,打印出 90=2*3*3*5</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">4、输入一行字符，分别统计出其中英文字母、空格、数字和其它字符的个数。</div>\r\n<div style=\"color:#000000;font-family:宋体, Tahoma;\">5、输入一串不少于10位的由数字组成的字符串