--
-- Table structure for table `oa_user`
--

DROP TABLE IF EXISTS `oa_user`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `oa_user` (
  `id` int(8) NOT NULL AUTO_INCREMENT,
  `account` varchar(20) NOT NULL DEFAULT '' COMMENT '用户名，账户名',
  `password` varchar(32) NOT NULL DEFAULT '' COMMENT '密码',
  `roleid` varchar(10) NOT NULL DEFAULT '' COMMENT '角色ID',
  `college_id` int(3) DEFAULT NULL COMMENT '学院',
  `realname` varchar(50) NOT NULL DEFAULT '' COMMENT '真实姓名',
  `avatar` varchar(50) DEFAULT '' COMMENT '头像',
  `gender` enum('f','m') NOT NULL DEFAULT 'f' COMMENT '性别',
  `email` varchar(30) DEFAULT '' COMMENT '邮箱',
  `qq` varchar(20) DEFAULT '' COMMENT 'QQ',
  `mobile` varchar(11) DEFAULT '' COMMENT '手机号码',
  `phone` varchar(20) DEFAULT '' COMMENT '座机号码',
  `join` date DEFAULT NULL COMMENT '加入时间',
  `visits` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '访问次数',
  `ip` varchar(15) NOT NULL DEFAULT '' COMMENT '登录IP',
  `last` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '最后一次登录时间',
  `department` varchar(100) DEFAULT NULL COMMENT '办公室',
  `specialty` varchar(50) DEFAULT NULL COMMENT '专业',
  `administrativeclass` varchar(30) DEFAULT NULL COMMENT '行政班',
  `polical_status` varchar(30) DEFAULT NULL COMMENT '政治面貌',
  `dormitory` varchar(50) DEFAULT NULL,
  `research` varchar(255) DEFAULT NULL,
  `title` varchar(20) DEFAULT NULL COMMENT '职称',
  `education` varchar(20) DEFAULT NULL COMMENT '学历',
  `status` enum('-1','0','1') DEFAULT '1' COMMENT '1 正常；0 禁用；-1 离校。',
  `deleted` enum('0','1') NOT NULL DEFAULT '0',
  `createtime` datetime DEFAULT NULL COMMENT '创建时间',
  `updatetime` datetime DEFAULT NULL COMMENT '更新时间',
  `fails` tinyint(5) DEFAULT '0',
  `totalfails` int(10) DEFAULT '0' COMMENT '用于检测是否恶意尝试破解密码',
  `locked` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '是否由于尝试的次数过多导致的锁定',
  `verification_code` varchar(6) DEFAULT NULL COMMENT '找回密码时的验证码',
  `verification_code_time` datetime DEFAULT NULL COMMENT '验证码生成时间',
  `grade` varchar(30) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `account` (`account`)
) ENGINE=InnoDB AUTO_INCREMENT=4324 DEFAULT CHARSET=utf8;
/*!40101 SET character_set_client = @saved_cs_client */;

